import './Login.css';
import { loginUrl } from './spotify';

function Login() {
  return (
    <div className="login">
       <img src="https://getheavy.com/wp-content/uploads/2019/12/spotify2019-830x350.jpg" alt="" />

       <a href={loginUrl}>LOG IN WITH SPOTIFY</a>

    </div>
  )
}

export default Login;
